import React from 'react';
import { StyleSheet, View } from 'react-native';

export default function StartMenu() {

    return(
        <h1>Floating Taco</h1>
    );
}

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    header: {
        fontSize: '28px',
        justifyContent: 'center',
    }
  });
